import React from 'react';
import { ChakraProvider } from '@chakra-ui/react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import MainPage from './MainPage';
import ActualExamPage from './components/ActualExamPage';

const App = () => {
  return (
    <ChakraProvider>
      <Router>
        <Routes>
          <Route path="/" element={<MainPage />} />
          <Route path="/actual-exam/:examId" element={<ActualExamPage />} />
        </Routes>
      </Router>
    </ChakraProvider>
  );
};

export default App;
